  false,\n\t\"url\": null,\n\t\"notes\": \"Bridge Creek originates along the northwestern
  slopes of Steens Mountain. It drains an area a fraction of the size of the Blitzen
  River watershed (approximately 30 square miles). Flow in Bridge Creek moves westerly
  toward the refuge where it enters roughly 3 miles northeast of Page Springs Dam.
  After entering the refuge, Bridge Creek joins East Canal for a short distance before
  separating again and flowing further west and into the Blitzen River. The purpose
  of this report is to provide information and analysis on the historical flows in
  Bridge Creek as it enters the refuge and compare those flows with flows in the Blitzen
  River.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
